            // Skip if file already exists
            if (File.Exists(filePath)) {
                Debug.Log($"Skipping {id}, already rendered at {filePath}");
                continue;
            }
            try {
                // Spawn object
                ActionFinished result = Controller.CreateRuntimeAsset(
                    id: id,
                    dir: "/Users/shengchen/Developer/ai2thor-hri/utils/data/output/assets",
                    extension: ".json"
                );

                if (!result.success) {
                    Debug.LogWarning($"Failed to create asset for {id}");
                    continue;
                }

                result = Controller.SpawnAsset(id, id);
                if (!result.success) {
                    Debug.LogWarning($"Failed to spawn asset for {id}");
                    continue;
                }
            } catch {
                Debug.LogError(id);
            }

            GameObject go = GameObject.Find(id);
            if (go == null) {
                Debug.LogWarning($"Spawned object {id} not found in scene");
                continue;
            }
            SetLayerRecursively(go, LayerMask.NameToLayer("AssetRender"));

            // Render to texture
            Texture2D tex = RenderObject(go, resolution, resolution);

            // Save image
            byte[] bytes = tex.EncodeToPNG();
            File.WriteAllBytes(filePath, bytes);
            Destroy(tex);

            // Clean up
            SimObjPhysics simObj = go.GetComponent<SimObjPhysics>();
            Manager.RemoveFromObjectsInScene(simObj);
            // Controller.RemoveFromScene(id);
            Destroy(go);

            // var assetDb = GameObject.FindObjectOfType<ProceduralAssetDatabase>();
            // var asset = assetDb.assetMap.getAsset(id);
            // Destroy(asset);
            // assetDb.assetMap.Clear();


            yield return null;
        }

        Debug.Log("Finished rendering all assets.");
    }

    Texture2D RenderObject(GameObject obj, int width, int height) {
        obj.transform.localEulerAngles = new Vector3(0, 180, 0);
        Bounds bounds = GetRenderableBounds(obj);

        // Setup camera
        GameObject camGO = new GameObject("TempCam");
        Camera cam = camGO.AddComponent<Camera>();
        cam.clearFlags = CameraClearFlags.SolidColor;
        cam.backgroundColor = new Color(0, 0, 0, 0); // Transparent
        cam.orthographic = false;
        cam.fieldOfView = 30f;
        cam.cullingMask = 1 << LayerMask.NameToLayer("AssetRender");

        // Position camera at yaw/pitch
        Vector3 dir = Quaternion.Euler(pitchAngle, yawAngle, 0) * Vector3.forward;

        // Distance to fit bounds into camera FOV
        float radius = bounds.extents.magnitude;
        float distance = radius / Mathf.Sin(cam.fieldOfView * Mathf.Deg2Rad / 2f);
        distance *= padding;

        // Position camera
        cam.transform.position = bounds.center - dir.normalized * distance;
        cam.transform.LookAt(bounds.center);

        // Set clip planes based on object size
        cam.nearClipPlane = Mathf.Max(0.01f, distance - radius * 2f);
        cam.farClipPlane = distance + radius * 2f + 100f;

        cam.transform.position = bounds.center - dir.normalized * distance;
        cam.transform.LookAt(bounds.center);

        // Render
        RenderTexture rt = new RenderTexture(width, height, 24, RenderTextureFormat.ARGB32);
        cam.targetTexture = rt;
        cam.Render();

        RenderTexture.active = rt;
        Texture2D tex = new Texture2D(width, height, TextureFormat.ARGB32, false);
        tex.ReadPixels(new Rect(0, 0, width, height), 0, 0);
        tex.Apply();

        RenderTexture.active = null;
        cam.targetTexture = null;

        Destroy(rt);
        Destroy(camGO);

        return tex;
    }

    static Bounds GetRenderableBounds(GameObject go) {
        Renderer[] renderers = go.GetComponentsInChildren<Renderer>();
        Bounds bounds = new Bounds(go.transform.position, Vector3.zero);
        foreach (Renderer r in renderers) {
            bounds.Encapsulate(r.bounds);
        }
        return bounds;
    }

    void SetLayerRecursively(GameObject obj, int newLayer) {
        if (obj == null) {
            return;
        }
        obj.layer = newLayer;
        foreach (Transform child in obj.transform) {
            if (child != null) {
                SetLayerRecursively(child.gameObject, newLayer);
            }
        }
    }
